import React from 'react'
import HomeIcon from '@material-ui/icons/Home';
import PostAddIcon from '@material-ui/icons/PostAdd';

export const SideBarData = [
    {
        title:"HomePage",
        icon:<HomeIcon/>,
        link: "/home"
    },
    {
        title:"Posts",
        icon:<PostAddIcon/>,
        link: "/posts"
    },
    {
        title:"Send Post",
        icon:<PostAddIcon/>,
        link: "/createpost"
    },
    {
        title:"Hakkımda",
        icon:<PostAddIcon/>,
        link: "/home"
    },
    
]
